INSERT INTO `people_people` VALUES (2,'Alexandre is a technology enthusiast and an IT consultant. Always searching for new technologies, he is constantly looking for what will shape the future of our societies. He enjoys breaking down systems into pieces to understand their underlying functionment and bring them back together to make them more efficient. As a software developer, he is driven by helping his colleagues to improve their work environment thanks to his home-made tools.','[{\"type\": \"paragraph_block\", \"value\": {\"text\": \"<p>Alexandre&#x27;s expertise does not end with computers. When he is not working on the latest applications for Except, he uses his broad knowledge to solve complex problems. Always curious to learn more, Alexandre pursued two Master\\u2019s degrees in Computer Science with a focus on Internet of Things at Telecom ParisTech and in Business &amp; Sustainability and Social Innovation at HEC Paris. His academic background makes him very versatile and capable of providing expertise on a broad range of fields.</p>\"}, \"id\": \"c8c7d653-609f-4ba6-9d94-a331057edb52\"}]','4.jpg','IT Specialist','+33626502091',2,NULL,'2018-11-11','Alexandre is a technology enthusiast and an IT consultant. Always searching for new technologies, he is constantly looking for what will shape the future of our societies. He enjoys breaking down systems into pieces to understand their underlying functionment and bring them back together to make them more efficient. As a software developer, he is driven by helping his colleagues to improve their work environment thanks to his home-made tools.',NULL,NULL,NULL,'IT Specialist',NULL),(3,'Joseph has a bird\'s eye view of global happenings and finds joy in contextualising far-off developments at a local level.   He has a BS of International Studies from Monash  University  in Melbourne,   work experience writing for various local and international publications, and crafting brand strategies from startups to global consulting firms. He is fascinated by technological advances leading Smart City technology, clean energy, circular economy,  as well as developments in the  CSR space. He also likes to spend as much time as physically possible in the ocean and accidentally \'shakas\' at inappropriate moments, fulfilling an  equilibrium    of   Australian stereotypes.','[{\"type\": \"paragraph_block\", \"value\": {\"text\": \"<p>Joseph is an Australian writer, journalist and most of all a creative positive impact communicator. He employs the knowledge he has earned from multiple stints living and working abroad and combines it with an ever-evolving theoretical backing. Bringing to the table a world of intercultural experience and a deep knowledge of how to communicate complex issues succinctly, Joseph understands the value of connection. It is the tool with which he has to drive significant change.</p>\"}, \"id\": \"53ce9e77-1755-449f-9ce3-f622358f3e39\"}]','10_lr2l7Y5.jpg','Communication/Public Relations','0107370215',3,NULL,'2018-02-06','Joseph has a bird\'s eye view of global happenings and finds joy in contextualising far-off developments at a local level.   He has a BS of International Studies from Monash  University  in Melbourne,   work experience writing for various local and international publications, and crafting brand strategies from startups to global consulting firms. He is fascinated by technological advances leading Smart City technology, clean energy, circular economy,  as well as developments in the  CSR space. He also likes to spend as much time as physically possible in the ocean and accidentally \'shakas\' at inappropriate moments, fulfilling an  equilibrium    of   Australian stereotypes.',NULL,NULL,NULL,'Communication/Public Relations',NULL),(4,'Mattia is an enthusiastic communicator and change maker: as an action researcher, he enjoys combining the solid theoretical background(s) he built along his academic career, with hands-on approaches and street-level interaction with stakeholders. Stemming from his experiences in different countries and cultures, the expertise Mattia developed stands at the crossroads where entrepreneurship, environmental stewardship, and social innovation meet. Overall, his curiosity for how societies transform and behave is only exceeded by his wonder for everything regarding the natural world. These animating principles drive him to constantly speculate on how these two interact.','[{\"type\": \"paragraph_block\", \"value\": {\"text\": \"<p>His efforts as a communicator focus on turning sustainability science-related insights into concrete tools for policy makers and business practitioners, bridging the gaps between research and practice.</p>\"}, \"id\": \"f14284cb-9f6e-4a88-b468-fa12662d9f0f\"}, {\"type\": \"paragraph_block\", \"value\": {\"text\": \"<p>When not busy diving into the latest sustainability innovation to produce thought leadership, you might find Mattia busy experimenting in the kitchen, hiking, or hiding in the closest movie house.</p>\"}, \"id\": \"7c21300c-4be9-4d54-9ac1-97c85cc027ec\"}]','1_RLmerVK.jpg','Communicator',NULL,4,NULL,'2019-01-14','Mattia is an enthusiastic communicator and change maker: as an action researcher, he enjoys combining the solid theoretical background(s) he built along his academic career, with hands-on approaches and street-level interaction with stakeholders. Stemming from his experiences in different countries and cultures, the expertise Mattia developed stands at the crossroads where entrepreneurship, environmental stewardship, and social innovation meet. Overall, his curiosity for how societies transform and behave is only exceeded by his wonder for everything regarding the natural world. These animating principles drive him to constantly speculate on how these two interact.',NULL,NULL,NULL,'Communicator',NULL);
/*!40000 ALTER TABLE `people_people` ENABLE KEYS */;
UNLOCK TABLES;

